          <h1><span class="secnum" id="sec-19.5.6.2.1"><a href="/sec/sec-nativeerror.prototype.html" title="link to this section">19.5.6.2.1</a></span> NativeError.prototype</h1>

          <p>The initial value of <b><i>NativeError</i><code>.prototype</code></b> is a <i>NativeError</i> prototype object (<a href="/sec/sec-properties-of-the-nativeerror-prototype-objects.html">19.5.6.3</a>). Each <i>NativeError</i> constructor has a
          distinct prototype object.</p>

          <p>This property has the attributes { [[Writable]]: <b>false</b>, [[Enumerable]]: <b>false</b>, [[Configurable]]:
          <b>false</b> }.</p>
